class Solution:

    def makeKeyValue(self,key:{},p_list:[])->{}:

        for i_list in p_list:
            if (key.get(i_list)):
                key[i_list] += 1
            else:
                key[i_list] = 1

        return key

    def minWindow(self, s: str, t: str) -> str:

        t_key = {}
        t_key = Solution.makeKeyValue(self,t_key,t)

        founded = False
        k = len(t)

        while(k <= len(s) ):
            for j in range(len(s)-k+1):

                j_key = {}
                j_key = Solution.makeKeyValue(self, j_key, s[j:j+k])
                substring_yn = True


                for i_t_key in t_key:
                    if(not j_key.get(i_t_key) or j_key[i_t_key] < t_key[i_t_key]):
                        substring_yn = False
                        break

                if not substring_yn:
                    continue
                start = j
                end = j+k
                founded = True

            if founded:
               break
            k = k+1

        if founded:
            return s[start:end]
        else:
            return ""

